import React from "react";
import Home from "./Home";
import About from "./About";
import Services from "./Services";
import Contact from "./Contact";
import { Route, Switch } from "react-router";

const App =()=>{
  return(
    <>
      <Switch>
        <Route exact path="/" component={Home} />
      </Switch>
    </>
  )
}
export default App;
